import React from 'react';

function SignIn(){
  return (
    <div>
      <Segment>
          <h1>Sign In</h1>
          <br />
          <Form>
            <Form.Field>
              <input name="name" placeholder="name..." />
            </Form.Field>
            <Form.Field>
              <input name="email" placeholder="email..." />
            </Form.Field>
            <Button>Sign In</Button>
          </Form>
        </Segment>
    </div>
  )
};

export default SignIn;
